        let id = basePokemon.id;
        let maxHealth = Math.floor(baseHealth * (1 + (chestsOpened / 5)));
        let catchRate = this.catchRateHelper(basePokemon.catchRate);
        let exp = basePokemon.exp;
        let money = 0;
