        // Optional array of costs
        this.costList = [];
        // Optional array of benefits
        this.bonusList = [];
        this.name = name;
        this.displayName = displayName;
        this.maxLevel = maxLevel;
        this.level = 0;
        this.costList = costList;
        this.bonusList = bonusList;
        this.increasing = increasing;
